});

function App() {
  const [quote, setQuote] = useState("");
  const getQuote = () =>{
    api.get('/').then(res => {
      console.log(res.data);
    setQuote(res.data);
    }).catch(err => {
      console.log(err);

    });
  };
  return (
    <button onClick={getQuote}>Get Quote</button>

  );
}

